var maximumSum = function(nums) {
    function gcd(a, b) {
        while (b !== 0) {
            [a, b] = [b, a % b];
        }
        return a;
    }

    function primeFactors(n) {
        let factors = new Map();
        for (let i = 2; i * i <= n; ++i) {
            while (n % i === 0) {
                factors.set(i, (factors.get(i) || 0) + 1);
                n /= i;
            }
        }
        if (n > 1) factors.set(n, (factors.get(n) || 0) + 1);
        return factors;
    }

    function getMask(n) {
        let factors = primeFactors(n);
        let mask = 0;
        for (let [prime, count] of factors) {
            if (count % 2 !== 0) {
                mask ^= (1 << (prime % 31));
            }
        }
        return mask;
    }

    let dp = new Map();
    let maxSum = 0;

    for (let num of nums) {
        let mask = getMask(num);
        dp.set(mask, (dp.get(mask) || 0) + num);
        for (let [m, sum] of dp) {
            if ((mask & m) === 0 || mask === m) {
                maxSum = Math.max(maxSum, sum + (mask !== m ? dp.get(mask) : 0));
            }
        }
    }

    return maxSum;
};
